public class InnerDataSourceSalesforceConfigurationFactory(Action<Humidifier.Kendra.DataSourceTypes.SalesforceConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Kendra.DataSourceTypes.SalesforceConfiguration>
{

    internal InnerDataSourceSalesforceStandardObjectAttachmentConfigurationFactory StandardObjectAttachmentConfigurationFactory { get; set; }

    internal InnerDataSourceSalesforceChatterFeedConfigurationFactory ChatterFeedConfigurationFactory { get; set; }

    internal InnerDataSourceSalesforceKnowledgeArticleConfigurationFactory KnowledgeArticleConfigurationFactory { get; set; }

    protected override Humidifier.Kendra.DataSourceTypes.SalesforceConfiguration Create()
    {
        var salesforceConfigurationResult = CreateSalesforceConfiguration();
        factoryAction?.Invoke(salesforceConfigurationResult);

        return salesforceConfigurationResult;
    }

    private Humidifier.Kendra.DataSourceTypes.SalesforceConfiguration CreateSalesforceConfiguration()
    {
        var salesforceConfigurationResult = new Humidifier.Kendra.DataSourceTypes.SalesforceConfiguration();

        return salesforceConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Kendra.DataSourceTypes.SalesforceConfiguration result)
    {
        base.CreateChildren(result);

        result.StandardObjectAttachmentConfiguration ??= StandardObjectAttachmentConfigurationFactory?.Build();
        result.ChatterFeedConfiguration ??= ChatterFeedConfigurationFactory?.Build();
        result.KnowledgeArticleConfiguration ??= KnowledgeArticleConfigurationFactory?.Build();
    }

} // End Of Class

